import React, {Suspense, useEffect, useState} from "react";
import {NavLink} from "react-router-dom";
import {Route} from "react-router";
import PatientBio from "./Patient Information/PatientBio";
import PatientForm from "./Patient Forms/PatientForm";


const Patient = (props) => {
    const [component, setComponent] = useState(null);

    const LoadComponent = location => {
        const Component = React.lazy(() => import(`./Patient Forms/${location}`));
        setComponent(<Component />);
    };

    useEffect(() => {
        // to load component from props
        props.name === undefined ?
            LoadComponent("PatientForm") :
            LoadComponent(props.name)

    },[props.name])

    return (

        <div className="person-wrapper">
            <div className="person-component-buttons">

                {/*<NavLink type="button" className="btn  btn-primary"*/}
                {/*         onClick={() => LoadComponent("PatientForm")} to={'#'}>*/}
                {/*    Create Patient*/}
                {/*</NavLink>*/}
                {/*<NavLink type="button" className="btn  btn-primary"*/}
                {/*         onClick={() => LoadComponent("FindPatient")} to={'#'}>*/}
                {/*    Find Patient*/}
                {/*</NavLink>*/}
                {/*<NavLink type="button" className="btn  btn-primary"*/}
                {/*         onClick={() => LoadComponent("PatientListTable")}   to={'#'}>*/}
                {/*    Patients List*/}
                {/*</NavLink>*/}


            </div>

            <div className="person-components">
                <Suspense fallback={<div>Loading...</div>}>
                <Route exact path={'/patient/test'} component={PatientForm}/>

                </Suspense>
            </div>


        </div>


    )

}

export default Patient;
